package com.servinglynk.hmis.warehouse.core.model;import com.fasterxml.jackson.annotation.JsonRootName;@JsonRootName("trustedAppStatus")public class TrustedAppStatus extends ClientModel{	private String trustedAppId;	private String status;	private String comment;	public String getTrustedAppId() {		return trustedAppId;	}	public void setTrustedAppId(String trustedAppId) {		this.trustedAppId = trustedAppId;	}	public String getStatus() {		return status;	}	public void setStatus(String status) {		this.status = status;	}	public void setComment(String comments) {		this.comment = comments;	}	public String getComment() {		return comment;	}}